import React from "react";
function TernaryOperator() {
  let loggedIn = false;
  return (
    <div>
      <h2>Logged In</h2>
      {loggedIn ? <p>Welcome</p> : <p>Please login</p>}
    </div>
  );
}

export default TernaryOperator;
